import '../styles/PanelCard.css';

type PanelCardProps = {
    title: string;
    task: string;
    relation: string;
  };

function PanelCard({ title, task, relation }: PanelCardProps) {
    return (
      <main className="panel-card">
        <section className="panel-card-header">
            <h3 style={{
                color: 'transparent',
                backgroundImage: 'linear-gradient(45deg, var(--orange-color), var(--text-color))',
                WebkitBackgroundClip: 'text',
                backgroundClip: 'text',
                fontWeight: 'bold',
            }}>{title}</h3>
            <h3>{task}</h3>
        </section>
        <section className="panel-card-divider"></section>
        <section className="panel-card-relation">
            <p style={{color: 'var(--text-color)'}}>How it relates to your goal</p>
            <p>{relation}</p>
        </section>
      </main>
    );
  }

  export default PanelCard;
